import React from "react";
// import { Col, Row, Container } from "../components/Grid";
// import Jumbotron from "../components/Jumbotron";

function Result( { videos, selectedId } ) {
  return (
    <ul>
      { videos.map( ( id ) => (
        <li
          key={ id }
          className={ id === selectedId ? 'is-selected' : null }>
          <iframe
            width="185"
            height="105"
            src={ 'https://www.youtube.com/embed/' + id } />
        </li>
      ) ) }
    </ul>
  );
}

const order = [
  'dQw4w9WgXcQ',
  'dMH0bHeiRNg',
  '9bZkp7q19f0'
];

const selectedId = '9bZkp7q19f0';

const rearrange = ( increment ) => () => {
  const index = order.indexOf( selectedId );
  const nextIndex = index + increment;
  if ( nextIndex < 0 || nextIndex >= order.length ) {
    return;
  }
  const selected = order[ index ];
  order.splice( index, 1 );
  order.splice( nextIndex, 0, selected );
  render();
};

function render() {
  ReactDOM.render(
    <div>
      <VideoList
        videos={ order }
        selectedId={ selectedId } />
      <div>
        <button type="button" onClick={ rearrange( -1 ) }>‹</button>
        <button type="button" onClick={ rearrange( 1 ) }>›</button>
      </div>
    </div>,
    document.getElementById( 'root' )
  );
}

render();

export default Result;
